export const confirmWord = () => {
  return dispatch({type:"CONFIRM"});
};

export const nextWord = () => {
  return dispatch({type:"NEXT_WORD"});
};

export const prevWord = () => {
  return dispatch({type:"PREVIOUS_WORD"});
};
